    </div>
  );
}

const Login = () => {
	return (
		<div className="bg-blue-300 m-auto w-80">
			<form className="flex flex-col justify-center items-center">
				<label className="flex flex-col m-8">
					Email:
					<input type="text" />
				</label>
				<label className="flex flex-col">
					Password:
					<input type="password" />
				</label>
			</form>
		</div>
	);
}

export default App;
